    display: flex;
    justify-content: center;
    align-items: center;
    
    margin-bottom: 2rem;
    padding: 1rem;
    height: 204px;
    background:#EFF3F6;
}
.contact__card_1 .foo {
    display: flex;
    justify-content: center;
    align-items: center;
     
   margin-bottom: 2rem;
   padding: 1rem;
   height: 204px;
   background: #2862AC;
 
} 
 @media (max-width: 768px) {
    .contact__card_1 {
        padding-left: 0px;
        padding-right: 0px;
        
    }
    .contact__card_2 {
        padding-left: 0px;
        padding-right: 0px;
    }
}

